import React from 'react';
import axios from 'axios';

const Logout = () => {
    const handleLogout = () => {
        // Call the server-side logout endpoint using Axios
        axios.post('/user/logout')
            .then(response => {
                // Handle successful logout
                console.log(response.data.message); // Output: Logout successful
                // Clear any client-side session-related data, such as user authentication tokens or session storage
                localStorage.removeItem('authToken');
                // Redirect the user to the login page or perform any other necessary action
                window.location.href = '/login'; // Redirect to the login page
            })
            .catch(error => {
                // Handle logout error
                console.error('Logout failed:', error.response.data.error);
                // Redirect the user to the login page or display an error message
                // For example, redirect to login page
                window.location.href = '/login'; // Redirect to the login page
            });
    };

    return (
        <div>
            <h1>Logging out...</h1>
            {handleLogout()}
        </div>
    );
};

export default Logout;
